import React, { Component } from "react";

export default class Home extends Component {
  render() {
    return (
      <div className="carpool">
        <div className="carpool__each">
          <div className="carpool__info">
            <div className="carpool__main">
              <h5>ROUTE 1</h5>
              <h3>Toronto - Waterloo</h3>
              <p>Passengers: 4</p>
            </div>
            <div className="carpool__money">
              <p>
                Money Owed:<br>$76.50</br>
              </p>
            </div>
          </div>
          <div className="carpool__map"></div>
        </div>
      </div>
    );
  }
}
